import React from "react";
import "../styles/footer.css";
import Nav from "react-bootstrap/Nav";

const Footer = () =>{
    return(
        <div className="footerContainer d-flex justify-content-center align-items-center" > 
        <div className="footerNavContainer">
                <Nav className="justify-content-center"  activeKey="/home" bg="transparent">
                <Nav.Item>
                <Nav.Link  href="/home"><h4 className="linkText">Home</h4></Nav.Link>
                </Nav.Item>
                <Nav.Item>
                <Nav.Link eventKey="link-1">Terms & Conditions</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                <Nav.Link eventKey="link-2">Contact</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                <Nav.Link eventKey="link-3">FAQ</Nav.Link>
                </Nav.Item>
                </Nav> 
        </div>
            
        </div>
        
    );
}

export default Footer;
